import React, { Component } from 'react';
import { Button } from 'reactstrap';
import "./widget1.css"

class Widget1 extends Component{
    render(){
        return(
            <div className="contenu">
            <p>Allez c'est parti </p>
            <Button color="warning">WOUAH</Button>
            <img src="http://www.dinosoria.com/foret-2/images/rosee_automne_jpg.jpg" alt="feuille"></img>
          </div>
        );
    }



}


export default Widget1;
